import React, { Component } from "react";
import Product from "./Product";

class ProductsTable extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <Product
        imageName={this.props.data[0].image}
        productName={this.props.data[0].name}
      />
    );
  }
}

export default ProductsTable;
